Sphyrapicus varius Sphyrapicus varius[2] ye una especie d'ave piciforme de la familia Picidae qu'habita en América del Norte, América Central y el Caribe. Descripción[editar | editar la fonte] El llombu y les nales son negres con franxes blanques. La cabeza ye negra con rayes blanques a los llaos. La frente y la coroniella son coloraes. El pechu y la parte cimera del banduyu son amarellentaos. El restu del banduyu y el anca son blancos, y la cola ye negra con una raya blanca pel centru. El gargü
..........
) nos llugares onde les sos rexones de distribución coinciden. Nel iviernu estes aves faen migraciones al sureste de los Estaos Xuníos, a les Indies Occidentales y a América Central. De xemes en cuando una ave apaez n'Irlanda o Gran Bretaña. Como los otros chupasavias, esta especie taladra furacos pequeños nos árboles pa comer la cazumbre y los inseutos que tán atraíos a ella. De cutiu caza inseutos direutamente del tueru y en plenu vuelu. Tamién come frutes y bagues. Na primavera cute los árbol
